$(function(){$("form, [type='submit']").submit(function(a){a.preventDefault()}),$("#sign-up-btn").click(function(a){a.preventDefault(),$.ajax({url:"/api/signup",data:{email:$("#email").val(),password:$("#pass").val()},method:"POST"}).then(a=>{console.log(a)}).fail(a=>{console.log(a)})}),$("#sign-in-btn").click(function(a){a.preventDefault(),$.ajax({url:"/api/login",data:{email:$("#email").val(),password:$("#pass").val()},method:"POST"}).then(a=>{a.id?window.location.replace("/"):console.log(a)}).fail(a=>{console.log(a)})}),$("#Select-Location a").click(function(){$("#Select-Location").addClass("hide"),$("#Select-Container").removeClass("hide"),console.log($(this).data("location-id"))})});